import logo from './logo.svg';
import './App.css';
import Main from './components/main.js';
function App() {  
  return (
    <div className="App">
       <h1>React development</h1>
       <img src={logo} className="App-logo" alt='logo'></img>
       <Main />
    </div>
  );
}

export default App;
